import React from 'react'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

export const SliderImg = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
      };
    const data = [
        {
            url: 'https://www.sephora.com/contentimages/homepage/071922/Homepage/RWD/2022-07-21-hp-slide-july-clean-planet-positive-skincare-us-ca-rwd-slice.jpeg?imwidth=1096',
            head: 'Eco-Concious & So Effective',
            p1: 'Exceptional Beauty.',
            p2: 'SHOP NOW',
            p2a: 'https://www.sephora.com/beauty/eco-friendly-beauty?icid2=homepage_slideshow_skincare_animation_cleanpp0722_us_image_rwd_072122'
        },
        {
            url: 'https://www.sephora.com/contentimages/homepage/070522/Homepage/RWD/2022-07-16-hp-slide-slotting-minis-us-rwd-slice.jpeg?imwidth=1096',
            head: 'Must-Have Minis',
            p1: 'Small but mighty picks to pocket right now.',
            p2: 'SHOP NOW',
            p2a: 'https://www.sephora.com/shop/travel-size-toiletries?icid2=homepage_slideshow_multi-world_slotting_minis_us_image_rwd_071622'
        },
        {
            url: 'https://www.sephora.com/contentimages/homepage/070522/Homepage/RWD/2022-07-12-hp-slide-value-sets-us-rwd-slice.jpeg?imwidth=1096',
            head: 'Value Sets',
            p1: 'Get the hottest beauty for less.',
            p2: 'SHOP NOW',
            p2a: 'https://www.sephora.com/shop/value-sets?icid2=homepage_slideshow_multi-world_slotting_valuesets_us_image_rwd_071222'
        },
        {
            url: 'https://www.sephora.com/contentimages/homepage/070522/Homepage/RWD/2022-07-08-hp-slide-just-arrived-july-rwd-us-slice.jpeg?imwidth=1096',
            head: 'The Last Lineup',
            p1: 'New beauty from the hottest brands',
            p2: 'SHOP NOW',
            p2a: 'https://www.sephora.com/beauty/new-beauty-products?icid2=homepage_slideshow_multi-world_slotting_justarrived_us_image_rwd_070822'
        }
    ]
  return (
    <div>
        <Slider {...settings}>
            {data.map((item) => {
                <>
                    <span>
                        <a href={item.p2a}>
                            <div className='img-div'>
                                <div className='img-css'>
                                    <img src={item.url} alt="" />
                                </div>
                                <div className='txt-div'>
                                    <h3>{item.head}</h3>
                                    <p>{item.p1}</p>
                                    <h2>{item.p2}</h2>
                                </div>
                            </div>
                        </a>
                    </span>
                </>
            })}
        </Slider>
    </div>
  )
}
